import './App.css'; // global css
import Header from './components/Header';
import About from './components/About';
import NewsTicker from './components/NewsTicker';


function App() {
  state = {
  todos:  [
     {
      id: 1,
      title: 'Dog',
      completed: false
    },
    {
      id: 2,
      title: 'Iguana',
      completed: false
    },
    {
      id: 3,
      title: 'Cat',
      completed: false
    }
]
};




  return (

    <div className="App-header">
    <NewsTicker />
    <Header/>
    <About/>
    </div>
  );
}


export default App;
